import React from "react";
import { Form, Input, Button } from "antd";

function LoginForm() {
  return (
    <Form>
      <Form.Item
        label="UserId"
        name="userId"
        rules={[{ required: true, message: "Please input username!" }]}
      >
        <Input />
      </Form.Item>
      <Form.Item
        label="Password"
        name="password"
        rules={[{ required: true, message: "Please input password!" }]}
      >
        <Input.Password />
      </Form.Item>
    </Form>
  );
}

export default LoginForm;
